  let start1 = 0;
  function handleplus() {
    start1 += 1;
    console.log(start1);
  }
  function count() {
    let start2 = 0;
    start2 += 1;
    console.log(start2);
  }

  return (
    <div>
      <button>-</button>
      <span> Step: 1 </span>
      <button onClick={handleplus}>+</button>
      <br></br>
      <button>-</button>
      <span> Count: 0 </span>
      <button onClick={count}>+</button>
      <>
        <p> today is {date} </p>
      </>
    </div>
  );
}
export default App;
